    {
        value: 'weekly',
        label: 'Weekly'
    },
    {
        value: 'every_two_weeks',
        label: 'Every 2 weeks'
    },
    {
        value: 'every_four_weeks',
        label: 'Every 4 weeks'
    },
    {
        value: 'monthly',
        label: 'Monthly'
    }
]

export default serviceCostTerm
